    false,nt"url": null,nt"notes": "This narrative report for Benton Lake,
    Willow Creek, Pishkun National Wildlife Refuge outlines Refuge accomplishments from
    September through December of 1950. The report begins by summarizing the weather
    conditions, habitat conditions, water conditions, and food and cover during this
    period. Wildlife- including migratory birds and upland game birds- is also covered.
    The Refuge development and maintenance section discusses physical developments.
    Resource management is outlined; topics include grazing and haying. N-R forms are
